class Solution(object):
    def missingNumber(self, nums):
        nums = sorted(nums)
        size = len(nums)
        for i in range(size):
            if i != nums[i]:
                return i
        return size

s = Solution()
assert s.missingNumber([0]) == 1
assert s.missingNumber([1]) == 0
assert s.missingNumber([0,1]) == 2
assert s.missingNumber([1,0]) == 2
